const Hero = () => {
  return (
    <div
      className="w-full bg-black h-30vh bg-contain bg-center bg-no-repeat"
      style={{
        minHeight: 300,
        backgroundImage: `url(${
          require("../../assets/images/wiggle.svg").default
        })`
      }}
    ></div>
  )
}

export default Hero
